import NavbarUser from '../src/components/NavbarUser'
import Home  from './pages/Home';
import './CSS/Login.css'
import NavbarBucks from './components/NavbarBucks';
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom"
import UserHome from './pages/UserHome'


import { useState } from 'react';

function PrivatePage(props) {
  return (
    <div>
      <h1>Welcome</h1>
      <button onClick={props.user}>Logout</button>
    </div>
  );
}

function GuestPage(props) {
  return (
    <div>
      <h1>Please Sign</h1>
      <button onClick={props.user}>Login</button>
    </div>
  );
}

function App() {
  const [isLoggedin, setIsLoggedin] = useState(false);
  return (
    <div>
      {isLoggedin ? (
        <PrivatePage logout={() => setIsLoggedin(!isLoggedin)} />
      ) : (
        <GuestPage login={() => setIsLoggedin(!isLoggedin)} />
      )}
    </div>
  );
}

export default App;
